const ByeSell = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
            }}
          >
            <p>COIN NAME</p>
            <p>BUYING AMOUNT</p>
            <p>SELLING AMOUNT</p>
            <p>GRID AMOUNT</p>
          </div>
          <div style={{ flex: 5 }}>kdkd</div>
        </div>
        <div style={{ flex: 5 }}>div_2</div>
      </div>
    </div>
  );
};

export default ByeSell;
